Redux Form Example
Redux Form is a sample app made with React Native, Redux, and Redux-Form and NativeBase as the main Libraries at work here.
This is a simple step-by-step tutorial to get familiar with basic concepts of Redux(used for state management), and [Redux-Form. This simple App should get you familiar with these Libraries and their use case. 
Find Full code here 


1. Aim
We aim to create a single page application that uses Redux-Form and has validation functionality.
2. Installation

SetUp React Native Project  SetUp a React Native project. Refer this for more information about setting up a React Native project. 
Installing Libraries  With a React Native project SetUp, We can now install all required Libraries as follows. 
a. Redux and react-redux 
In your terminal enter the following 

npm install redux react-redux --save

b. redux-form 
Do this

npm install --save redux-form

c. NativeBase 

npm install native-base --save

Configure all dependencies by running the following command 

react-native link

Note: You might have some problems setting up the project due to version conflicts, make sure you use same versions as mentioned below in the package.json
By the end of Installation, your package.json file should look something like this.


